import React from "react";
import "./sidebar.css";

const Sidebar = () => {
  return (
    <div className="sidebar">
      <li>
        <i className="ri-home-4-fill"></i>Home
      </li>
      <li>Your Appointments</li>
      <li>Patient Information</li>
    </div>
  );
};

export default Sidebar;
